	"mot": "classique",
	"variantes": [{
		"orthographes": [{
			"formes": [{
				"valeur": "classique",
				"catgram": "adjectif",
				"origine": "latin <i>classicus, </i>de première classe",
				"definitions": [{
					"division": [{
						"contenu": [{
							"texte": "Qui appartient à l'Antiquité gréco-latine",
							"exemples": ["Les langues classiques."]
						}]
					}, {
						"contenu": [{
							"texte": "Se dit de certains artistes et écrivains du XVII et d'une partie du XVIIIᵉ s., ainsi que des musiciens du XVIIIᵉ s."
						}]
					}, {
						"contenu": [{
							"texte": "Qui a les caractères esthétiques privilégiés par cette époque, caractères inspirés des choix esthétiques de l'Antiquité gréco-latine (lignes régulières, mesure, etc.) [par opposition à romantique ou à baroque]",
							"exemples": ["Beauté classique."]
						}]
					}, {
						"contenu": [{
							"texte": "Se dit, dans l'évolution artistique de telle ou de telle civilisation, d'une période où s'allient qualité technique, rationalité, harmonie. (De 480 à 330 avant J.-C. environ en Grèce, de 250 à 950 environ chez les Mayas, etc.)"
						}]
					}, {
						"contenu": [{
							"texte": "Axé sur l'étude des langues grecque et latine et de la littérature",
							"exemples": ["Études classiques."]
						}]
					}, {
						"contenu": [{
							"texte": "Qui mérite d'appartenir à la culture générale et est enseigné dans des classes (par opposition à une œuvre ou à un auteur mineurs) ou qui a atteint une notoriété telle qu'il sert de référence dans son genre",
							"exemples": ["Connaître ses auteurs classiques.", "L'ouvrage de ce médecin est devenu classique."]
						}]
					}, {
						"contenu": [{
							"texte": "Se dit, par opposition à la musique folklorique, légère, de variétés, au jazz ou à la musique contemporaine, de la musique, des œuvres des musiciens composées dans le cadre de la tradition musicale occidentale."
						}]
					}, {
						"contenu": [{
							"texte": "Qui appartient à une grande tradition, par opposition à ce qui est marginal ou nouveau, moderne, etc.",
							"exemples": ["C'est là une théorie classique."]
						}]
					}, {
						"contenu": [{
							"texte": "Qui est conforme aux usages établis, au goût traditionnel",
							"exemples": ["Un costume de coupe classique et sobre."]
						}]
					}, {
						"indicateur": ["Familier. "],
						"contenu": [{
							"texte": "Qui a ordinairement lieu dans telles ou telles circonstances, qui ne surprend pas ; habituel",
							"exemples": ["Il m'a opposé les arguments classiques en pareil cas."]
						}]
					}, {
						"rubrique": "Armement",
						"contenu": [{
							"texte": "Synonyme de conventionnel."
						}]
					}, {
						"rubrique": "Linguistique",
						"contenu": [{
							"texte": "Se dit d'un état de langue correspondant à un moment pris comme référence et norme. (On a qualifié de français classique la langue des XVIIᵉ et XVIIIᵉ s.)"
						}]
					}, {
						"rubrique": "Physique",
						"contenu": [{
							"texte": "Se dit de toute théorie (ou partie de la physique) élaborée antérieurement à 1900."
						}]
					}, {
						"rubrique": "Technique",
						"contenu": [{
							"texte": "Se dit d'un dispositif, d'une installation, etc., connus et utilisés depuis longtemps, par opposition aux dispositifs, installations, etc., de même type faisant appel à des techniques nouvelles."
						}]
					}]
				}]
			}]
		}]
	}]
